// import 'bootstrap/dist/css/bootstrap.min.css';
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import './style.css'
import Form from 'react-bootstrap/Form';
import InputGroup from 'react-bootstrap/InputGroup';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import ModalLogin from './modal-login';
import { useState } from 'react';

function Header() {
  const [show, setShow] = useState(false);

  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);
  return (
    <div className='bg-header'>
    <Navbar  expand="lg">
      <Container>
        <Navbar.Brand href="#"><img src="./images/Icon.png" alt='test' width="300px"/></Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav
            className="me-auto my-2 my-lg-0"
            style={{ maxHeight: '100px' }}
            navbarScroll>

            <Nav.Link href="#action1"></Nav.Link>
          </Nav>
            <Button className="btn-outline" type='button' onClick={handleShow}>Login</Button>
            <Button className="btn-yellow" >Register</Button>
        </Navbar.Collapse>
      </Container>
    </Navbar>
    <Container className='header-content d-flex flex-column'>
        <div className='font-title'>
            <h1 className='fw-semibold' style={{fontSize:'64px', color:'#fff'}}>Explore</h1>
            <p>your amazing city together</p>
        </div>

        <div>
        <label style={{color: '#fff', fontSize:'18px'}}>Find great places to holiday</label>
        <InputGroup className="mb-3 mt-2">
            <Form.Control
                placeholder="Recipient's username"
                aria-label="Recipient's username"
                aria-describedby="basic-addon2"
            />
            <InputGroup.Text className='btn-yellow' >Search</InputGroup.Text>
        </InputGroup>
        </div>

    </Container> 
    <ModalLogin show={show} />
    </div>
  );    
}

export default Header
